.portal-box-body {
  height: 100%;
  >>> .el-carousel,
  >>> .el-carousel__container {
    height: 100%;
    min-height: 130px;
  }
  .indicator-top {
    >>> .el-carousel__indicators {
      top: 0;
    }
  }
  .indicator-left {
    >>> .el-carousel__indicators {
      left: 0;
    }
  }
  .indicator-none {
    >>> .el-carousel__indicators {
      display: none;
    }
  }
  .web-link,
  img {
    width: 100%;
    height: 100%;
  }
  .bottom-text {
    position: absolute;
    width: calc(100% - 20px);
    height: 30px;
    line-height: 30px;
    bottom: 0;
    font-size: 14px;
    background: #000;
    color: #fff;
    padding: 0 10px;
    box-sizing: content-box;
  }
}
